import React, { Component } from "react";
import "./Card.css";
class Card extends Component {
  render() {
    return (
      <div className="col-auto mb-3">
        <div
          className="card"
          style={{ width: "17rem", margin: "0 2.5em 0 2.5em" }}
        >
          <img
            onClick={() => alert("Hello")}
            src={props.image}
            className="card-img-top"
            alt="shabuMenu"
            style={{ height: "197px", transition: "transform .2s" }}
          ></img>
          <div className="card-body">
            <p
              className="card-text"
              style={{
                fontSize: "1.5rem",
                textAlign: "center"
              }}
            >
              {props.text}
            </p>
          </div>
        </div>
      </div>
    );
  }
}
export default Card;
